import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


window.React1 = require('react');

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();


const express = require('express'); 
const app = express(); 
const port = 3001; // You can use any port you prefer 

app.set('view engine', 'ejs'); // Set up EJS as the view engine 

// Define routes for different pages 
app.get('/', (req, res) => { 
  res.render('index'); // Renders index.ejs in this example 
}); 

app.get('/ghana', (req, res) => { 
  res.render('ghana'); // Renders about.ejs in this example 
}); 

// Add more routes for other pages... 

// Start the server 
app.listen(port, () => { 
  console.log(`Server is running on port ${port}`); 
});
